import React, { useEffect } from 'react';

const GoogleAuth = () => {
    useEffect(() => {
        window.gapi.load('client:auth2', () => {
            window.gapi.client.init({
                clientId: '198419312917-kkklc0mjchgud6o8ekjbtugtjad6q62t.apps.googleusercontent.com',
                scope: 'email'
            });
        });
    }, []);

    return (
        <div>Google Auth.</div>
    );
};

export default GoogleAuth;
